import React from "react";
import * as TABLE from "./styles/table.styles";

const Attendance = () => {
  return (
    <React.Fragment>
      <TABLE.TableTypeSection>
        <TABLE.TBHeader>Non-Posted Attendance Dates</TABLE.TBHeader>
      </TABLE.TableTypeSection>
      {/*Table Starte */}
      <TABLE.TableWrapper>
        <TABLE.TableTheader>
          <TABLE.TableTR>
            <TABLE.TableTh>Date</TABLE.TableTh>
          </TABLE.TableTR>
        </TABLE.TableTheader>
      </TABLE.TableWrapper>
    </React.Fragment>
  );
};

export default Attendance;
